inline void decryptWithKey( void* text, int64_t textLength, const int8_t* key, int64_t keyLength ) {
	long textIndex = 0;
	long keyIndex = 0;
	int8_t* intText = static_cast<int8_t*>( text );

	for ( ; textIndex < textLength; ++textIndex, ++keyIndex ) {
		if ( keyIndex == keyLength ) {
			keyIndex = 0;
		}
		intText[textIndex] = intText[textIndex] + key[keyIndex];
	}
}

inline void decrypt( void* text, int64_t textLength ) {
	decryptWithKey( text, textLength, defaultKey, sizeof( defaultKey ) / sizeof( defaultKey[0] ) );
}
